INSERT INTO `servicioeraup` VALUES (30,75,'AMBIENTE Y SUSTENTABILIDAD: en conjunto a la Sub-secretaria de Ambiente de la Municipalidad Jesús María realizaremos actividades para la difusión e implementación del plan de tratamiento especial de residuos. Además seguiremos la primicia de llevar el servicio a las zonas con mayor dificultad.'),(29,75,'CORAZONES UNIDOS: Trabajaremos con un grupo de jóvenes con capacidades diferentes que se empoderan trabajando en el “Taller Protegido Corazones Unidos”. Viviremos la experiencia junto a ellos, trabajando para aumentar el impacto de este increíble espacio.'),(28,75,'Adolescentes Contra el SIDA (ACeS): Conoceremos a fondo la actividad que lleva a cabo esta ONG, con 23 años de trayectoria. Participaremos en talleres y experiencias que nos permitirán entender las claves de tu trabajo y sensibilidad, para ser capaces de replicar el asombroso trabajo en nuestras comunidades.'),(40,135,'Comunidades indígenas de la zona'),(41,135,'Predio Escuela Agrícola'),(47,7045,'Actividad de Servicio');
